    /**
     * Show the application dashboard.
     *
     * @return \Illuminate\Contracts\Support\Renderable
     */
    public function searchFlights( Request $request )
    {
        $input = $request->all();

        $session_params['country'] = 'US';
        $session_params['locale'] = 'en-US';
        $session_params['currency'] = $input['currency'];
        $session_params['originPlace'] = $input['sourceId'];
        $session_params['destinationPlace'] = $input['destinationId'];
        $session_params['outboundDate'] = date('Y-m-d', strtotime($input['outboundDate']));
        $session_params['adults'] = $input['adults'];
        $session_params['inboundDate'] = date('Y-m-d', strtotime($input['inboundDate']));;
        $session_params['cabinClass'] = $input['cabinClass'];
        $session_params['children'] = $input['children'];
        $session_params['infants'] = $input['infants'];

        $sessionId = !empty($input['sessionKey']) ? $input['sessionKey'] : "";
        
        if( empty($sessionId) ) {
            $result = $this->createFlightSession( $session_params );
            if( $result['status'] == 'success' ) {
                $sessionId = $result['data']['sessionId'];
            }
        }

        if( !empty($sessionId) ) {
            $result = $this->getFlightSession([], $sessionId);
        }

        return response($result)
            ->header('Content-Type', 'application/json; charset=UTF-8');
    }

    /**
     * Show the application dashboard.
     *
     * @return \Illuminate\Contracts\Support\Renderable
     */
    public function getFlightSession( $params, $sessionId )
    {
        $result = [
            'status' => 'error',
            'message' => '',
            'data' => [],
        ];  
        try {
            $apiUrl = $this->flightpoll_url . $sessionId;
            $client = new Client(); //GuzzleHttp\Client
            $response = $client->get($apiUrl, [
                'headers' => [
                    'x-rapidapi-host' => 'skyscanner-skyscanner-flight-search-v1.p.rapidapi.com',
                    'x-rapidapi-key' => 'pk9NBs4gd2msh4jwiFZy3D241fvZp1J6rRVjsnis2NPGFU0R5s'
                ],
                'query' => $params
            ]);

            if( $response->getReasonPhrase() == 'OK' ) {
                $RootObject = $response->getBody()->getContents();
                $RootObject = json_decode($RootObject);
                // $RootObject = $this->getRootObject()->RootObject;
                $FlightResult = new App\FlightResult( $RootObject );
                $FomatedResult = $FlightResult->getResults();

                $result['status'] = "success";
                $result['message'] = "Success";
                $result['data'] = $FomatedResult;
            }
        } catch (RequestException $e) {
            $result['message'] = Psr7\str($e->getRequest());
            if ($e->hasResponse()) {
                $result['message'] .= Psr7\str($e->getResponse());
            }
        }

        return $result;
    }

    /**
     * Show the application dashboard.
     *
     * @return \Illuminate\Contracts\Support\Renderable
     */
    public function createFlightSession( $params )
    {
        $result = [
            'status' => 'error',
            'message' => '',
            'data' => [],
        ];

        try {
            $client = new Client(); //GuzzleHttp\Client
            $response = $client->post($this->flightsession_url, [
                'headers' => [
                    'x-rapidapi-host' => 'skyscanner-skyscanner-flight-search-v1.p.rapidapi.com',
                    'x-rapidapi-key' => 'pk9NBs4gd2msh4jwiFZy3D241fvZp1J6rRVjsnis2NPGFU0R5s'
                ],
                'form_params' => $params
            ]);

            if( $response->getReasonPhrase() == 'Created' ) {
                $location = $response->getHeader('Location')[0];
                $location = explode("/", $location);
                $sessionId = end($location);

                $result['status'] = "success";
                $result['message'] = "Success";
                $result['data']['sessionId'] = $sessionId;
            }
        } catch (RequestException $e) {
            $result['message'] = Psr7\str($e->getRequest());
            if ($e->hasResponse()) {
                $result['message'] .= Psr7\str($e->getResponse());
            }
        }

        return $result;
    }

    /**
     * Show the application dashboard.
     *
     * @return \Illuminate\Contracts\Support\Renderable
     */
    public function filterObject( $array, $search, $by = 'Id' )
    {
        $search_arr = (is_array($search)) ? $search : [$search];
        $result = Arr::where($array, function ($item, $key) use ($search_arr, $by) {
            return in_array($item->{$by}, $search_arr);
        });

        return (is_array($search)) ? array_values($result) : Arr::first($result);
    }

    /**
     * Show the application dashboard.
